import List from "./components/list";
import Count from "./components/header"

function App() {
  return (
    <div className="font body ">
    <Container className="py-5 " >
    <Count persons={persons} />
    <List persons={persons} />

    <Buttons />
    </Container>
    </div>
  );
}

export default App;
